import Gauge from './Gauge.js'

class GaugeHolder extends Component {
    constructor(props) {
        super(props);
        this.state = {
            items: [],
            isLoaded: false,
            id
        }
    }

    componentDidMount() {

        fetch('https://www.hikingproject.com/data/get-trails-by-id?ids='+{id}+'&key=200962200-a3f1d16081e9f29cfec2bd00a7bd1948')
    }
    render() {
        return (
            <div className="Gaugeholder">

            </div>
        )
    }
}
export default GaugeHolder
